440\u0431\u0443\u0440\u0433\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433<\/a> \u0441\u0432\u043e\u0451 \u043f\u0435\u0440\u0432\u043e\u0435 \u0443\u0447\u0451\u043d\u043e\u0435 \u0441\u043e\u0447\u0438\u043d\u0435\u043d\u0438\u0435 (\u00ab\u041e\u0431\u0440\u0430\u0437\u0447\u0438\u043a \u0437\u043d\u0430\u043d\u0438\u044f\u00bb) \u00ab\u041e \u043f\u0440\u0435\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0442\u0432\u0451\u0440\u0434\u043e\u0433\u043e \u0442\u0435\u043b\u0430 \u0432 \u0436\u0438\u0434\u043a\u043e\u0435\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1740_%D0%B3%D0%BE%D0%B4\" title=\"1740 \u0433\u043e\u0434\">1740<\/a>&#160;\u2014 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u0430\u043c\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%82%D0%BE%D1%80%D0%B0%D1%8F_%D0%9A%D0%B0%D0%BC%D1%87%D0%B0%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D1%8D%D0%BA%D1%81%D0%BF%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D1%8F\" class=\"mw-redirect\" title=\"\u0412\u0442\u043e\u0440\u0430\u044f \u041a\u0430\u043c\u0447\u0430\u0442\u0441\u043a\u0430\u044f \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f\">\u0412\u0442\u043e\u0440\u043e\u0439 \u041a\u0430\u043c\u0447\u0430\u0442\u0441\u043a\u043e\u0439 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%B8%D0%BD%D0%B3,_%D0%92%D0%B8%D1%82%D1%83%D1%81\" class=\"mw-redirect\" title=\"\u0411\u0435\u0440\u0438\u043d\u0433, \u0412\u0438\u0442\u0443\u0441\">\u0412\u0438\u0442\u0443\u0441\u0430 \u0411\u0435\u0440\u0438\u043d\u0433\u0430<\/a> \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%BF%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D1%81%D0%BA-%D0%9A%D0%B0%D0%BC