\u0431\u0432\u0438\u00bb. \u041a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0443 \u0442\u043e\u0433\u0434\u0430 \u0435\u0449\u0451 \u043d\u0435 \u0438\u0441\u043f\u043e\u043b\u043d\u0438\u043b\u043e\u0441\u044c 14 \u043b\u0435\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1831_%D0%B3%D0%BE%D0%B4\" title=\"1831 \u0433\u043e\u0434\">1831<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B0%D1%80%D0%B0%D0%B4%D0%B5%D0%B9,_%D0%9C%D0%B0%D0%B9%D0%BA%D0%BB\" title=\"\u0424\u0430\u0440\u0430\u0434\u0435\u0439, \u041c\u0430\u0439\u043a\u043b\">\u041c\u0430\u0439\u043a\u043b \u0424\u0430\u0440\u0430\u0434\u0435\u0439<\/a> \u043f\u0440\u043e\u0438\u0437\u0432\u0451\u043b \u043f\u0435\u0440\u0432\u043e\u0435 \u0443\u0441\u043f\u0435\u0448\u043d\u043e\u0435 \u0438\u0441\u043f\u044b\u0442\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%B3%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u0438\u0439 \u0433\u0435\u043d\u0435\u0440\u0430\u0442\u043e\u0440\">\u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u0434\u0438\u043d\u0430\u043c\u043e<\/a>, \u043e\u0442\u043a\u0440\u044b\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%BC%D0%B0%D0%B3%D0%BD%D0%B8%D1%82%D0%BD%D0%B0%D1%8F_%D0%B8%D0%BD%D0%B4%D1%83%D0%BA%D1%86%D0%B8%D1%8F\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043c\u0430\u0433\u043d\u0438\u0442\u043d\u0430\u044f \u0438\u043d\u0434\u0443\u043a\u0446\u0438\u044f\">\u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043c\u0430\u0433\u043d\u0438\u0442\u043d\u0443\u044e \u0438\u043d\u0434\u0443\u043a\u0446\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1855_%D0%B3%D0%BE%D0%B4\" title=\"1855 \u0433\u043e\u0434\">1855<\/a>&#160;\u2014 \u0430\u043d\u0433\u043b\u0438\u0447\u0430\u043d\u0438\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%81%D1%81%D0%B5%D0%BC%D0%B5%D1%80,_%D0%93%D0%B5%D0%BD%D1%80%D0%B8\" title=\"\u0411\u0435\u0441\u0441\u0435\u043c\u0435\u0440, \u0413\u0435\u043d\u0440\u0438\">\u0413\u0435\u043d\u0440\u0438 \u0411\u0435\u0441\u0441\u0435\u043c\u0435\u0440<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u0441\u0432\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%81%D1%81%D0%B5%D0%BC%D0%B5%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%86%D0%B5%D1%81%D1%81\" title=\"\u0411\u0435\u0441\u0441\u0435\u043c\u0435\u0440\u043e\u0432\u0441\u043a\u0438\u0439 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\">\u043f\u0440\u043e\u0446\u0435\u0441\u0441 \u043f\u0440\u0438\u0433\u043e\u0442\u043e\u0432\u043b\u0435\u043d\u0438\u044f<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%BB%D1%8C\" title=\"\u0421\u0442\u0430\u043b\u044c\">\u0441\u0442\u0430\u043b\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1855_%D0%B3%D0%BE%D0%B4\" title=\"1855 \u0433\u043e\u0434\">1855<\/a>&#160;\u2014 c\u043e\u0441\u0442\u043e\u044f\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D1%83_%D0%9A%D0%B8%D0%BD%D0%B1%D1%83%D1%80%D0%BD%D0%B0_(1855)\" title=\"\u0421\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0443 \u041a\u0438\u043d\u0431\u0443\u0440\u043d\u0430 (1855)\">\u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u0443 \u041a\u0438\u043d\u0431\u0443\u0440\u043d\u0430<\/a>. \u0412 \u044d\u0442\u043e\u043c \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0438 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0431\u044b\u043b\u0438 \u043f\u0440\u0438\u043c\u0435\u043d\u0435\u043d\u044b \u0431\u0440\u043e\u043d\u0435\u043d\u043e\u0441\u043d\u044b\u0435 \u043a\u043e\u0440\u0430\u0431\u043b\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1869_%D0%B3%D0%BE%D0%B4\" title=\"1869 \u0433\u043e\u0434\">1869<\/a>&#160;\u2014 \u043f\u043e \u0437\u0430\u0434\u0430\u043d\u0438\u044e \u0433\u0430\u0437\u0435\u0442\u044b \u00ab\u041d\u044c\u044e-\u0419\u043e\u0440\u043a \u0413\u0435\u0440\u0430\u043b\u044c\u0434\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D0%BD%D1%80%D0%B8_%D0%9C%D0%BE%D1%80%D1%82%D0%BE%D0%BD_%D0%A1%D1%82%D1%8D%D0%BD%D0%BB%D0%B8\" class=\"mw-redirect\" title=\"\u0413\u0435\u043d\u0440\u0438 \u041c\u043e\u0440\u0442\u043e\u043d \u0421\u0442\u044d\u043d\u043b\u0438\">\u0413\u0435\u043d\u0440\u0438 \u0421\u0442\u044d\u043d\u043b\u0438<\/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0441\u044f \u043d\u0430 \u043f\u043e\u0438\u0441\u043a\u0438 \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B8%D0%BD%D0%B3%D1%81%D1%82%D0%BE%D0%BD,_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4\" title=\"\u041b\u0438\u0432\u0438\u043d\u0433\u0441\u0442\u043e\u043d, \u0414\u0430\u0432\u0438\u0434\">\u0414\u044d\u0432\u0438\u0434\u0430 \u041b\u0438\u0432\u0438\u043d\u0433\u0441\u0442\u043e\u043d\u0430<\/a>, \u043f\u0440\u043e\u043f\u0430\u0432\u0448\u0435\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u0444\u0440\u0438\u043a\u0430\">\u0410\u0444\u0440\u0438\u043a\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1888_%D0%B3%D0%BE%D0%B4\" title=\"1888 \u0433\u043e\u0434\">1888<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D1%83%D1%88%D0%B5%D0%BD%D0%B8%D0%B5_%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BF%D0%BE%D0%B5%D0%B7%D0%B4%D0%B0\" class=\"mw-redirect\" title=\"\u041a\u0440\u0443\u0448\u0435\u043d\u0438\u0435 \u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u0435\u0437\u0434\u0430\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0446\u0430\u0440\u0441\u043a\u043e\u0433\u043e \u043f\u043e\u0435\u0437\u0434\u0430<\/a> \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%80%D1%8C%D0%BA%D0%BE%D0%B2\" title=\"\u0425\u0430\u0440\u044c\u043a\u043e\u0432\">\u0425\u0430\u0440\u044c\u043a\u043e\u0432\u043e\u043c<\/a> (\u0411\u043e\u0440\u043a\u0438).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1896_%D0%B3%D0%BE%D0%B4_%D0%B2_%D1%82%D0%B5%D0%B0%D1%82%D1%80%D0%B5\" title=\"1896 \u0433\u043e\u0434 \u0432 \u0442\u0435\u0430\u0442\u0440\u0435\">1896<\/a>&#160;\u2014 \u043f\u043e\u043b\u043d\u044b\u043c \u043f\u0440\u043e\u0432\u0430\u043b\u043e\u043c \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80\" title=\"\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438\u043d\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0438\u043d\u0441\u043a\u043e\u043c \u0442\u0435\u0430\u0442\u0440\u0435<\/a> \u043f\u0440\u0435\u043c\u044c\u0435\u0440\u0430 \u043f\u044c\u0435\u0441\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%BE%D0%B2,_%D0%90%D0%BD%D1%82%D0%BE%D0%BD_%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0427\u0435\u0445\u043e\u0432, \u0410\u043d\u0442\u043e\u043d \u041f\u0430\u0432\u043b\u043e\u0432\u0438\u0447\">\u0410. \u0427\u0435\u0445\u043e\u0432\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D0%B9%D0%BA%D0%B0_(%D0%BF%D1%8C%D0%B5%D1%81%D0%B0)\" title=\"\u0427\u0430\u0439\u043a\u0430 (\u043f\u044c\u0435\u0441\u0430)\">\u0427\u0430\u0439\u043a\u0430<\/a>\u00bb, \u043f\u043e\u0441\u043b\u0435 \u0447\u0435\u0433\u043e \u043e\u043d \u0437\u0430\u0440\u0451\u043a\u0441\u044f \u043f\u0438\u0441\u0430\u0442\u044c \u0447\u0442\u043e-\u043b\u0438\u0431\u043e \u0434\u043b\u044f \u0441\u0446\u0435\u043d\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1897_%D0%B3%D0%BE%D0%B4\" title=\"1897 \u0433\u043e\u0434\">1897<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B8%D0%BE%D0%BB%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%AD%D0%B4%D1%83%D0%B0%D1%80%D0%B4%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0426\u0438\u043e\u043b\u043a\u043e\u0432\u0441\u043a\u0438\u0439, \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d \u042d\u0434\u0443\u0430\u0440\u0434\u043e\u0432\u0438\u0447\">\u041a.&#160;\u042d.&#160;\u0426\u0438\u043e\u043b\u043a\u043e\u0432\u0441\u043a\u0438\u0439<\/a> \u0441\u043e\u043e\u0431\u0449\u0438\u043b \u043e \u043f\u043e\u0441\u0442\u0440\u043e\u0439\u043a\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D0%B4%D0%B8%D0%BD%D0%B0%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%82%D1%80%D1%83%D0%B1%D0%B0\" title=\"\u0410\u044d\u0440\u043e\u0434\u0438\u043d\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0442\u0440\u0443\u0431\u0430\">\u0430\u044d\u0440\u043e\u0434\u0438\u043d\u0430\u043c\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0442\u0440\u0443\u0431\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1902_%D0%B3%D0%BE%D0%B4\" title=\"1902 \u0433\u043e\u0434\">1902<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%82%D1%80%D0%BE%D0%B9%D1%82\" title=\"\u0414\u0435\u0442\u0440\u043e\u0439\u0442\">\u0414\u0435\u0442\u0440\u043e\u0439\u0442\u0435<\/a> \u0432\u044b\u043f\u0443\u0449\u0435\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c \u043c\u0430\u0440\u043a\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B4%D0%B8%D0%BB%D0%BB%D0%B0%D0%BA\" class=\"mw-redirect\" title=\"\u041a\u0430\u0434\u0438\u043b\u043b\u0430\u043a\">\u041a\u0430\u0434\u0438\u043b\u043b\u0430\u043a<\/a>\u00bb. \u041e\u0442\u0434\u0435\u043b\u0435\u043d\u0438\u0435 \u043a\u043e\u043d\u0446\u0435\u0440\u043d\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/General_Motors\" title=\"General Motors\">\u0414\u0436\u0435\u043d\u0435\u0440\u0430\u043b \u041c\u043e\u0442\u043e\u0440\u0441<\/a>\u00bb \u043f\u043e \u0432\u044b\u043f\u0443\u0441\u043a\u0443 \u043b\u0435\u0433\u043a\u043e\u0432\u044b\u0445 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u0435\u0439 \u043a\u043b\u0430\u0441\u0441\u0430 \u00ab\u043b\u044e\u043a\u0441\u00bb, \u0431\u044b\u043b\u043e \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u043a\u0430\u043a Cadillac Automobile Company \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u043d\u0438\u043c\u0430\u0442\u0435\u043b\u0435\u043c \u0423\u0438\u043b\u044c\u044f\u043c\u043e\u043c \u041c\u0451\u0440\u0444\u0438 (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">William Murphy<\/span>) \u0438 \u0432\u044b\u0434\u0430\u044e\u0449\u0438\u043c\u0441\u044f \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u043e\u043c \u0413. \u041b\u0438\u043b\u0430\u043d\u0434\u043e\u043c (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Henry Martyn Leland<\/span>). \u0421\u0432\u043e\u0451 \u0437\u0432\u0443\u0447\u043d\u043e\u0435 \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0430 \u0432 \u043f\u0430\u043c\u044f\u0442\u044c \u043e\u0431 \u0410\u043d\u0442\u0443\u0430\u043d\u0435 \u0434\u0430 \u041b\u0430 \u041c\u043e\u0442\u0442 \u041a\u0430\u0434\u0438\u043b\u043b\u0430\u043a\u0435 (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Antoine Laumet de La Mothe, Sieur de Cadillac<\/span>), \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u0435 \u0433\u043e\u0440\u043e\u0434\u0430 \u0414\u0435\u0442\u0440\u043e\u0439\u0442\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B3%D1%80%D0%B8%D1%8F\" title=\"\u0412\u0435\u043d\u0433\u0440\u0438\u044f\">\u0412\u0435\u043d\u0433\u0440\u0438\u044f<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0441\u0438\u043b\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u043e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B8%D1%8F\" title=\"\u0410\u0432\u0441\u0442\u0440\u0438\u044f\">\u0410\u0432\u0441\u0442\u0440\u0438\u0438<\/a>. \u0412 \u043e\u043a\u0442\u044f\u0431\u0440\u0435 1918 \u0433\u043e\u0434\u0430 \u0432 \u0412\u0435\u043d\u0433\u0440\u0438\u0438 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f. \u0412\u0435\u043d\u0433\u0440\u0438\u044f \u0441\u0442\u0430\u043b\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u044b\u043c \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u043e\u043c. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/21_%D0%BC%D0%B0%D1%80%D1%82%D0%B0\" title=\"21 \u043c\u0430\u0440\u0442\u0430\">21 \u043c\u0430\u0440\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919 \u0433\u043e\u0434\u0430<\/a> \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 \u0412\u0435\u043d\u0433\u0435\u0440\u0441\u043a\u043e\u0439 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0439 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439, \u043f\u043e\u0441\u043b\u0435 \u043f\u0430\u0434\u0435\u043d\u0438\u044f \u043a\u043e\u0442\u043e\u0440\u043e\u0439 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1_%D0%B0%D0%B2%D0%B3%D1%83%D1%81%D1%82%D0%B0\" title=\"1 \u0430\u0432\u0433\u0443\u0441\u0442\u0430\">1 \u0430\u0432\u0433\u0443\u0441\u0442\u0430<\/a> 1919 \u0433\u043e\u0434\u0430) \u0432 \u0441\u0442\u0440\u0430\u043d\u0435 \u0431\u044b\u043b\u0430 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u0434\u0438\u043a\u0442\u0430\u0442\u0443\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%BE%D1%80%D1%82%D0%B8,_%D0%9C%D0%B8%D0%BA%D0%BB%D0%BE%D1%88\" title=\"\u0425\u043e\u0440\u0442\u0438, \u041c\u0438\u043a\u043b\u043e\u0448\">\u0425\u043e\u0440\u0442\u0438<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>\u2014<a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a> \u0433\u0433.).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1918_%D0%B3%D0%BE%D0%B4\" title=\"1918 \u0433\u043e\u0434\">1918<\/a>&#160;\u2014 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u043e\u0441\u043d\u043e\u0432\u0430\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%B8%D0%B3%D1%80%D1%83%D1%88%D0%BA%D0%B8_(%D0%A1%D0%B5%D1%80%D0%B3%D0%B8%D0%B5%D0%B2_%D0%9F%D0%BE%D1%81%D0%B0%D0%B4)\" title=\"\u041c\u0443\u0437\u0435\u0439 \u0438\u0433\u0440\u0443\u0448\u043a\u0438 (\u0421\u0435\u0440\u0433\u0438\u0435\u0432 \u041f\u043e\u0441\u0430\u0434)\">\u041c\u0443\u0437\u0435\u0439 \u0438\u0433\u0440\u0443\u0448\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%80%D0%BC%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%BD%D0%BE%D0%B9_%D0%BA%D1%80%D0%B0%D0%B5%D0%B2%D0%B5%D0%B4%D1%87%D0%B5%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9\" title=\"\u041c\u0443\u0440\u043c\u0430\u043d\u0441\u043a\u0438\u0439 \u043e\u0431\u043b\u0430\u0441\u