:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%BC%D0%B0%D0%B7\" title=\"\u0410\u043b\u043c\u0430\u0437\">\u0430\u043b\u043c\u0430\u0437\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1961_%D0%B3%D0%BE%D0%B4\" title=\"1961 \u0433\u043e\u0434\">1961<\/a><ul><li>\u041e\u0442\u043a\u0440\u044b\u043b\u0441\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/XXII_%D1%81%D1%8A%D0%B5%D0%B7%D0%B4_%D0%9A%D0%9F%D0%A1%D0%A1\" title=\"XXII \u0441\u044a\u0435\u0437\u0434 \u041a\u041f\u0421\u0421\">XXII \u0441\u044a\u0435\u0437\u0434 \u041a\u041f\u0421\u0421<\/a> (\u043f\u0440\u043e\u0445\u043e\u0434\u0438\u043b \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/31_%D0%BE%D0%BA%D1%82%D1%8F%D0%B1%D1%80%D1%8F\" title=\"31 \u043e\u043a\u0442\u044f\u0431\u0440\u044f\">31 \u043e\u043a\u0442\u044f\u0431\u0440\u044f<\/a>), \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u0431\u044b\u043b\u0430 \u043f\u0440\u0438\u043d\u044f\u0442\u0430 3-\u044f \u041f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u041a\u041f\u0421\u0421<\/a> \u0438 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 \u0437\u0430\u0434\u0430\u0447\u0430 \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u0438\u044f \u043a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1980_%D0%B3%D0%BE%D0%B4\" title=\"1980 \u0433\u043e\u0