1\u0441\u043d\u0430\">Cessna<\/a>\u00bb \u00abModel T303 Crusader\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1985_%D0%B3%D0%BE%D0%B4\" title=\"1985 \u0433\u043e\u0434\">1985<\/a>&#160;\u2014 \u0432\u044b\u043f\u0443\u0449\u0435\u043d \u043f\u0435\u0440\u0432\u044b\u0439 32-\u0440\u0430\u0437\u0440\u044f\u0434\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D1%86%D0%B5%D1%81%D1%81%D0%BE%D1%80\" class=\"mw-redirect\" title=\"\u041f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440\">\u043f\u0440\u043e\u0446\u0435\u0441\u0441\u043e\u0440<\/a> \u0434\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/IBM_PC-%D1%81%D0%BE%D0%B2%D0%BC%D0%B5%D1%81%D1%82%D0%B8%D0%BC%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BC%D0%BF%D1%8C%D1%8E%D1%82%D0%B5%D1%80\" class=\"mw-redirect\" title=\"IBM PC-\u0441\u043e\u0432\u043c\u0435\u0441\u0442\u0438\u043c\u044b\u0439 \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\">IBM PC-\u0441\u043e\u0432\u043c\u0435\u0441\u0442\u0438\u043c\u044b\u0445 \u043a\u043e\u043c\u043f\u044c\u044e\u0442\u0435\u0440\u043e\u0432<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Intel_80386\" class=\"mw-redirect\" title=\"Intel 80386\">Intel 80386<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1988_%D0%B3%D0%BE%D0%B4\" title=\"1988 \u0433\u043e\u0434\">1988<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0438\u0441\u043f\u043e\u043b\u043d\u0435\u043d\u0430 \u0441\u0447\u0438\u0442\u0430\u0432\u0448\u0430\u044f\u0441\u044f \u043f\u0440\u043e\u043f\u0430\u0432\u0448\u0435\u0439 10-\u044f \u0441\u0438\u043c\u0444\u043e\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%82%D1%85%D0%BE%D0%B2%D0%B5%D0%BD,_%D0%9B%D1%8E%D0%B4%D0%B2%D0%B8%D0%B3_%D0%B2%D0%B0%D0%BD\" title=\"\u0411\u0435\u0442\u0445\u043e\u0432\u0435\u043d, \u041b\u044e\u0434\u0432\u0438\u0433 \u0432\u0430\u043d\">\u0411\u0435\u0442\u0445\u043e\u0432\u0435\u043d\u0430<\/a> (<span lang=\"de\" style=\"font-style: italic\" xml:lang=\"de\">Ludwig van Beethoven<\/span>). \u041e\u043d\u0430 \u0431\u044b\u043b\u0430 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u043c \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%BF%D0%B5%D1%80,_%D0%91%D0%B0%D1%80%D1%80%D0%B8\" title=\"\u041a\u0443\u043f\u0435\u0440, \u0411\u0430\u0440\u0440\u0438\">\u0411\u0430\u0440\u0440\u0438 \u041a\u0443\u043f\u0435\u0440\u043e\u043c<\/a> (<span lang=\"en\" style=\"font-style: italic\" xml:lang=\"en\">Barry Cooper<\/span>) \u043d\u0430 \u043e\u0441\u043d\u043e\u0432\u0435 \u043e\u0431\u043d\u0430\u0440\u0443\u0436\u0435\u043d\u043d\u044b\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%80%D0%BB%D0%B8%D0%BD\" title=\"\u0411\u0435\u0440\u043b\u0438\u043d\">\u0411\u0435\u0440\u043b\u0438\u043d\u0435<\/a> \u0431\u0443\u043c\u0430\u0433 \u0432\u0435\u043b\u0438\u043a\u043e\u0433\u043e \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0442\u043e\u0440\u0430, \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u0432\u0448\u0438\u0445 \u0444\u0440\u0430\u0433\u043c\u0435\u043d\u0442\u044b \u0438 \u043d\u0430\u0431\u0440\u043e\u0441\u043a\u0438 \u0441\u0438\u043c\u0444\u043e\u043d\u0438\u0438, \u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u0442\u0440\u0443\u0434\u043d\u043e \u0441\u0447\u0438\u0442\u0430\u0442\u044c \u0435\u0451 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0443\u044e\u0449\u0435\u0439 \u0438\u0441\u0442\u0438\u043d\u043d\u043e\u043c\u0443 \u0437\u0430\u043c\u044b\u0441\u043b\u0443 \u0411\u0435\u0442\u0445\u043e\u0432\u0435\u043d\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1989_%D0%B3%D0%BE